import React from 'react'
import dropdownStyle from './dropdown.module.scss';
import { NavLink } from 'react-router-dom';
import ReactCSSTransitionGroup from 'react-transition-group';
interface OwnProps {
    items: { title: string, url: string }[]
}

type Props = OwnProps;
const Dropdown: React.FC<Props> = (props) => {
    return (
        <div className={dropdownStyle.Items}>
            {props.items.map((item: { title: string, url: string }) => {
                return (
                    <ReactCSSTransitionGroup transitionName = "menu" transitionEnterTimeout={1000} transitionLeaveTimeout={1000}> 
                    <NavLink className={dropdownStyle.Item} to={item.url} activeClassName={dropdownStyle.Current}>
                       &bull; {item.title}
                    </NavLink>
                    </ReactCSSTransitionGroup>

                )
            })}
        </div>
    )
}


export default Dropdown;
